import React from "react";

const Pages = () => {
  const addPage = () => {};

  return (
    <div className="custom-comp">
      <h1 className="title-dashboard">الصفحات التعريفية</h1>
      <div className="search-add-product flex-between">
        <button onClick={addPage}>اضافة صفحة</button>
      </div>
      <div>
        <h2>الصفحات التعريفية</h2>
        <div>
          <p>الشروط و الاحكام</p>
          <label className="custom-checkbox">
            <input type="checkbox" />
          </label>
        </div>
        <div>
          <p>سياسة الخصوصية</p>
          <label className="custom-checkbox">
            <input type="checkbox" />
          </label>
        </div>
      </div>
    </div>
  );
};

export default Pages;
